import React from "react";

const Form = () => {
    const [userData, setUserData] = React.useState(
        {
            username: '', 
            password: '' 
        }
    );

    return (
        <form>
            <div>
                <label>Username:</label>
                <input type='text' name='username' value={userData.username}></input>
            </div>
            
            <div>
                <label>Password:</label>
                <input type='text' name='password' value={userData.password}></input>
            </div>

            <button>Login</button>
        </form>
    )
}

export default Form;
